import React from 'react';
import { Card,Button } from 'react-bootstrap';

const MemberItem = ({member}) => {

    const borrowedItem = member.currentlyBorrowedBooks;

  return (
    <div className='memberCard card-columns'> 
        <h2>{`${member.firstName} ${member.lastName}`}</h2> 
        {`Borrowed Item: ${member.currentlyBorrowedBooks.length}`} 
        <Card>
            <Card.Header>{`${member.membership}`}</Card.Header>
            <Card.Body>
                <Card.Title>{`${member.firstName} ${member.lastName}`}</Card.Title>
                <Card.Text>{`Borrowed Item: ${member.currentlyBorrowedBooks}`}</Card.Text>
                <Button variant="primary">Go somewhere</Button>
            </Card.Body>
        </Card>
    </div>
    );
};

export default MemberItem;
